import React from 'react';
import './App.css';
import UserBar from '../components/UserBar'
import Menu from '../components/Menu'
import QuestionCard from '../components/QuestionCard'
import QuestionList from '../components/QuestionList'

function App() {
  return (
    <div className="App">
      <UserBar/>
      <Menu/>
      <QuestionList/>
    </div>
  );
}

export default App;
